import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

import Login from './components/Auth/Login';
import Register from './components/Auth/Register';
import TaskList from './components/Dashboard/TaskList';

function Home() {
  return (
    <div className="container mt-4">
      <h1 className="text-primary">Halo, TugasKu!</h1>
      <p>Selamat datang di aplikasi manajemen tugas.</p>
    </div>
  );
}

function About() {
  return (
    <div className="container mt-4">
      <h2>Tentang Aplikasi</h2>
      <p>Aplikasi ini membantu kamu mengelola tugas harian dengan mudah.</p>
    </div>
  );
}

export default function App() {
  return (
    <Router>
      <nav className="navbar navbar-expand navbar-dark bg-dark px-3">
        <Link className="navbar-brand" to="/">TugasKu</Link>
        <div className="navbar-nav">
          <Link className="nav-link" to="/">Beranda</Link>
          <Link className="nav-link" to="/about">Tentang</Link>
          <Link className="nav-link" to="/tasks">Tugas</Link>
          <Link className="nav-link" to="/login">Login</Link>
          <Link className="nav-link" to="/register">Register</Link>
        </div>
      </nav>

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/tasks" element={<TaskList />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
      </Routes>
    </Router>
  );
}
